The constellation of the Pleiades provides a vehicle for us to explore a series of paradoxes and epochal discoveries for humanity. The untold story of the modern &quot;sisters of the sun,&quot; the early 20th century female astronomers, led by two deaf women, at Harvard who catalogued the stars. It's also the story of the young British woman who joined forces with them, her defiance of the world's leading expert, and how she taught the world what the stars are really made of.

